import './App.css';
import YoutubeVidio from './01/YoutubeVideo';
import YoutubeLylic from './01/YoutubeLylic';

function App() {
  const arr = ["여보세요", "거기", "누구", "없소"];
  return (
    <div className="App">
      <YoutubeVidio link="//www.youtube.com/embed//lJPALoI4Y8I?start=41&end=48"></YoutubeVidio>
      <YoutubeLylic array={arr}/>
    </div>
  );
}

export default App;
